script: |
  super -f text -I q1099.spq | sort > q1099.out

inputs:
  - name: q1099.spq
    data: |
      SELECT col1 FROM tab0 (FORMAT parquet) WHERE NOT - col0 BETWEEN - col0 * - col0 * ( - ( + 64 ) ) * - + col1 AND - col1;
  - name: tab0

outputs:
  - name: q1099.out
    data: |
      1
      21
      81
